import React from 'react';
import {Container, Row} from 'react-bootstrap'
import User from './User';

const AllUser = (props) => {
    return (
        <div>
            <Container>
                <Row>
                    {
                    props.AllUserData.map((item,index) => {
                        return <User AllUserInfo={item} key ={index}/>
                    })
                    }
                    
                </Row>
            </Container>
        </div>
    );
}

export default AllUser;
